    return(
        <>
            <Heading/>
            <Form/>
            <Calculation/>
        </>  
    )  
}

function Heading(){
    return(
        <div>
            <h3>Tip Calculator</h3>
            <br/>
        </div>
    )
}

function Form(){
    return(
        <div> 
            <p>How much was the bill?</p><input type="text"></input>
            <p>How did you like the service?</p><input type="text"></input>
            <p>How did you friend like the service?</p><input type="text"></input>
        </div>
    )
}

function Calculation(){
    return(
        <div>
            <br/>
            <p style={{fontWeight : 'bold'}}>You pay $</p>
        </div>
    )
}
